#version 100
// This is a VP stub
attribute vec3 _glesVertex;
uniform mat4 matrix_model;
uniform mat4 matrix_viewProjection;
void main() { 
    gl_Position = matrix_viewProjection * matrix_model * vec4(_glesVertex, 1.0); 
}

#version 100
// This is a VP stub
precision mediump float;
void main(void) { 
    gl_FragColor = vec4(1, 0, 1, 1); 
}

